import Header from "./components/Header";

import GeminiHome from "./pages/GeminiHome";
import LoginPage from "./pages/LoginPage";
import SignupPage from "./pages/SignUpPage";
import ObservePage from "./pages/ObservePage";
import AstroPage from "./pages/AstroPage";
import SciplanPage from "./pages/SciplanPage";
import ProfilePage from "./pages/ProfilePage";

import './index.css'


import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import { useState } from "react";

function App() {

  const [authUser, setAuthUser] = useState(null);

  const handleLogout = () => {
    setAuthUser(null);
  };

  return (
    <Router>

      <Header authUser={authUser} />

      <main className="pt-16">
        <Routes>
          <Route path="/" element={authUser ? <Navigate to="/" /> : <LoginPage setAuthUser={setAuthUser} />} />
          <Route path="/home" element={<GeminiHome authUser={authUser} />} />
          <Route path="/login" element={<LoginPage setAuthUser={setAuthUser} />} />
          <Route path="/logout" element={<LoginPage setAuthUser={handleLogout} />} />
          <Route path="/profile" element={<ProfilePage authUser={authUser} setAuthUser={setAuthUser} />} />
          <Route path="/signup" element={<SignupPage setAuthUser={setAuthUser} />} />
          <Route path="/observation" element={<ObservePage authUser={authUser} />} />
          <Route path="/astrodata" element={<AstroPage authUser={authUser} />} />
          <Route path="/sciplan" element={<SciplanPage authUser={authUser} />} />
        </Routes>
      </main>
    </Router>
  );
}

export default App;
